import styled from "styled-components";
import { Link } from "react-router-dom";

export const NavbarContainer = styled.div`
	display: flex;
	flex-direction: row;
	justify-content: space-between;
	width: 100%;
	height: 70px;
	margin: 10px;
	margin-bottom: 30px;
`;
